import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Services from './pages/Services';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/services" element={<Services />} />
          <Route path="/contact" element={<div>Page Contact - En construction</div>} />
          <Route path="/login/:type" element={<div>Page Login - En construction</div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
